def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""

    parts = input1.split()
    result = []

    for part in parts:
        sub_parts = part.split('-')
        camel_case = sub_parts[0] + ''.join(sub.capitalize() for sub in sub_parts[1:])
        result.append(camel_case)

    return ' '.join(result)
